import React from 'react';

const RadioSelect = (props) => {
  const { name, value, label, checked, onChange } = props;

  return (
    <div>
      <input
        type="radio"
        name={name}
        value={value}
        checked={checked}
        onChange={onChange}
      />
      {label}
    </div>
  );
}

export default RadioSelect;
